import Navbar from './components/Utilities/navbar/Navbar';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  useRouteMatch,
} from "react-router-dom";
import { Routes } from 'react-router';

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>
      <Routes></Routes>
        <HomePage />
      </BrowserRouter>

      <Footer />

    </div>
  );
}

export default App;
